import { cn } from "@/lib/utils";
import { Currency } from "@/value-objects/currency";

export type CountryFlagProps = {
  currency: Currency;
  width?: number;
  noBorder?: boolean;
};

export const CountryFlag = ({
  currency,
  width = 24,
  noBorder = false,
}: CountryFlagProps) => {
  return (
    <div
      className={cn("inline-block shrink-0 overflow-hidden rounded", {
        "border-primary border-2": !noBorder,
      })}
    >
      <img src={countriesFlags[currency]} alt="currency" width={width} />
    </div>
  );
};

